import React from 'react';
import laptop from './logo/laptop.jpg'
import airbus from './logo/airbus.jpg'
import airarabia from './logo/airarabia.jpg'
const Sdata =[
    {
        imgsrc: laptop,
        title : 'laptop',
    },
    {
        imgsrc: airbus,
        title : 'airbus',
    },
    {
        imgsrc: airarabia,
        title : 'ara arabia',
    },
    {
        imgsrc: laptop,
        title : 'laptop',
    },
    {
        imgsrc: airarabia,
        title : 'ara arabia',
    },
    {
        imgsrc: laptop,
        title : 'laptop',
    },
]
export default Sdata
